'use client'

import { useCallback, useEffect, useRef, useState } from 'react'
import { sendNotification } from './browser-notifications'

const NOTIFICATION_SOUND = "data:audio/wav;base64,"

export interface SoundNotificationHook {
  hasUserInteracted: boolean
  playNotificationSound: () => Promise<void>
  initializeAudio: () => void
}

function unlockAudio() {
  const audio = new Audio(
    "data:audio/wav;base64,UklGRpYDAABXQVZFZm10IBAAAAABAAEARKwAAIhYAQACABAAZGF0YXIDAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA"
  );
  audio.volume = 0; // ensure muted
  audio.play().catch(() => {
    // ignored  some browsers block play without gesture
  });
}

/**
 * Custom hook for handling sound notifications with Safari compatibility
 * Manages audio context initialization and user interaction requirements
 */
export function useSoundNotification(): SoundNotificationHook {
  const [hasUserInteracted, setHasUserInteracted] = useState(false)
  const audioContextRef = useRef<AudioContext | null>(null)

  // Initialize audio context on first user interaction for Safari compatibility
  const initializeAudioContext = useCallback(() => {
    if (!audioContextRef.current) {
      try {
        const AudioContextClass = window.AudioContext || (window as any).webkitAudioContext as typeof AudioContext
        audioContextRef.current = new AudioContextClass()
        
        // Resume audio context if it's suspended (Safari requirement)
        if (audioContextRef.current.state === 'suspended') {
          audioContextRef.current.resume()
        }
        
        console.log('[SOUND] Audio context initialized for Safari')
      } catch (error) {
        console.log('Could not initialize audio context:', error)
      }
    }
  }, [hasUserInteracted])

  // Create notification sound with better Safari compatibility
  const playNotificationSound = useCallback(async () => {
    if (!hasUserInteracted) {
      console.log('[SOUND] Cannot play sound - no user interaction yet')
      return
    }
    
    // Initialize audio context if needed
    initializeAudioContext()
    
    if (!audioContextRef.current) {
      console.log('[SOUND] No audio context available')
      return
    }

    const audioContext = audioContextRef.current
    
    try {
      // Resume context if suspended (Safari often suspends it)
      if (audioContext.state === 'suspended') {
        await audioContext.resume()
      }
        
      try {
        const audio = new Audio(NOTIFICATION_SOUND)
        audio.volume = 0.1
        await audio.play()
      } catch (fallbackError) {
        console.log('Notification sound failed', fallbackError)
      }
    } catch (error) {
        console.log('Could not play notification sound:', error)
    }
  }, [hasUserInteracted, initializeAudioContext])

  // Initialize audio context manually (can be called from outside)
  const initializeAudio = useCallback(() => {
    initializeAudioContext()
  }, [initializeAudioContext])

  // Detect user interaction for Safari audio requirements
  useEffect(() => {
    const handleUserInteraction = () => {
      console.log('[SOUND] User interaction detected - enabling audio')
      setHasUserInteracted(true)
      
      // Initialize audio context immediately on first interaction
      if (!audioContextRef.current) {
        try {
          const AudioContextClass = window.AudioContext || (window as any).webkitAudioContext as typeof AudioContext
          audioContextRef.current = new AudioContextClass()
          
          // Resume audio context if it's suspended (Safari requirement)
          if (audioContextRef.current.state === 'suspended') {
            audioContextRef.current.resume()
          }

          unlockAudio()
          
          console.log('[SOUND] Audio context initialized on user interaction')
        } catch (error) {
          console.log('Could not initialize audio context on interaction:', error)
        }
      }
      
      // Remove listeners after first interaction
      document.removeEventListener('click', handleUserInteraction)
      document.removeEventListener('keydown', handleUserInteraction)
      document.removeEventListener('touchstart', handleUserInteraction)
    }

    if (!hasUserInteracted) {
      document.addEventListener('click', handleUserInteraction, { passive: true })
      document.addEventListener('keydown', handleUserInteraction, { passive: true })
      document.addEventListener('touchstart', handleUserInteraction, { passive: true })
    }

    return () => {
      document.removeEventListener('click', handleUserInteraction)
      document.removeEventListener('keydown', handleUserInteraction)
      document.removeEventListener('touchstart', handleUserInteraction)
    }
  }, [hasUserInteracted])

  return {
    hasUserInteracted,
    playNotificationSound,
    initializeAudio
  }
}

/**
 * Hook for managing chat status notifications
 * Handles the logic for detecting when assistant messages are complete
 */
export function useChatStatusNotification(
  status: string,
  playNotificationSound: () => Promise<void>
) {
  const previousStatusRef = useRef<string>('ready')
  const [hasStreamingStarted, setHasStreamingStarted] = useState(false)

  useEffect(() => {
    console.log(`[CHAT] Status changed to: ${status}`)
    
    const previousStatus = previousStatusRef.current
    
    // Track when streaming starts to avoid initial ready state
    if (status === 'streaming') {
      setHasStreamingStarted(true)
    }
    
    // Play notification sound and send browser notification when transitioning from streaming to ready
    // (indicating assistant message is complete)
    if (previousStatus === 'streaming' && status === 'ready' && hasStreamingStarted) {
      console.log('[CHAT] Assistant message completed - playing notification sound and sending browser notification')
      
      // Play sound notification
      playNotificationSound()
      
      // Send browser notification
      sendNotification(
        'Agent Response Complete',
        'The AI assistant has finished responding to your message.'
      ).catch((error) => {
        console.log('[CHAT] Failed to send browser notification:', error)
      })
    }
    
    // Update previous status ref
    previousStatusRef.current = status
  }, [status, hasStreamingStarted, playNotificationSound])

  return { hasStreamingStarted }
}
